class DataUser:
    def __init__(self, data_source):
        self.data_source = data_source

    def process_deletion(self, date):
        deleted_records = [record for record in self.data_source if record['date'] == date]
        self.data_source = [record for record in self.data_source if record['date'] != date]
        return deleted_records


