class FileUploadValidator:
    VALID_EXTENSIONS = ['.csv', '.xlsx', '.txt']

    def validate_submission_file(self, file_name):
        if any(file_name.endswith(ext) for ext in self.VALID_EXTENSIONS):
            return "File is valid for submission."
        else:
            return "Invalid file extension."
